import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';
import Card from '@material-ui/core/Card';
import Box from '@material-ui/core/Box';
import Button from '@material-ui/core/Button';


  const useStyles = makeStyles((theme) => ({
    root: {
      '& > *': {
        margin: theme.spacing(1),
        width: '25ch',
      },
    },
    box: {

      display: "flex",
      flexDirection: "column",
      justifyContent: "center",
      marginTop: '5%',
      marginLeft: '20%',
      marginRight: '20%',
      textAlign: "center"
    },
    card: {

      display: "flex",
      flexDirection: "column",
      justifyContent: "center",
      marginTop: '5%',
      textAlign: "center"
    },
    textfield:{
      marginTop:'5%',
      marginLeft:'30%',
      marginRight:'30%'
    },
    button: {

      width: '155px',
      height: '45px',
      background: '#202020 0% 0% no-repeat padding-box',
      borderRadius: '80px',
      opacity: '1',
      display: "flex",
      justifyContent: "center",
      margin: 'auto',
      marginTop: '10%',
      marginBottom: '10%',
      color: 'white'
  }
  }));

  export default function BasicTextFields() {

    const classes = useStyles();

    return (
      <form className={classes.root} noValidate autoComplete="off">
        <Box Container className={classes.box}>
        <Card>
        <TextField className={classes.textfield}  label="Organisation" variant="outlined" />
        <br/>
        <TextField  className={classes.textfield}  id="outlined-basic" label="Department" variant="outlined" />
        <br/>
        <TextField className={classes.textfield}  id="outlined-basic" label="Team Name" variant="outlined" />
        <br/>
        <TextField className={classes.textfield}  id="outlined-basic" label="Industry" variant="outlined" />
        <br/>
        <TextField className={classes.textfield}  id="outlined-basic" label="Sub Industry" variant="outlined" />
        <br/>
        <TextField className={classes.textfield}  id="outlined-basic" label="Team Function" variant="outlined" />
        <br/>
        <TextField className={classes.textfield}  id="outlined-basic" label="Stakeholders" variant="outlined" />
        <br/>
        <Button variant="contained" className={classes.button} color="primary" >
           Create Team
        </Button>
        </Card>
        </Box>
      </form>
    );
  }
